import foot from './foot.png';
import olympic from './olympic.png';

image = foot;
const Change = () => {
    if(image===foot) {
        image = olympic;
    } else {
        image = foot;
    }
};

const Bodies = () => {
    setTimeout(Change, 5000)
    return (
        <p><img src={image} height="900" width="1200"/></p>
    )
};

export default Bodies;
